package corejava;

public class IFelseExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 10;
		int b = 20;

		if (a > b) {
			System.out.println("A is lesser");
		}
		else
			System.out.println("B is lesser");
		System.out.println("After the if clause");


	}

}
